e g\\u00e9olocalis\\u00e9e, aux structures d\\u2019assistance sociale (SAMU, les Sapeurs-Pompiers, la Police, etc).\",\"project_problem_solution_innovative\":\"Le produit que nous proposons est innovant car qu\\u2019il fournit \\u00e0 la fois aux populations, et aux diff\\u00e9rents services un outil unique de g\\u00e9olocalisation et de communication afin d\\u2019acc\\u00e9l\\u00e9rer la prise en charge des incidents n\\u00e9cessitants des interventions.\",\"project_problem_solution_link\":\"https:\\/\\/www.cover-art.me\\/auxilium\",\"project_problem_solution_level\":\"95 %\",\"project_payment\":\"Le service Auxilium s\\u2019adresse \\u00e0 toute personne poss\\u00e9dant un mobile connect\\u00e9 \\u00e0 internet. Peu importe l\\u2019\\u00e2ge, le sexe ou la profession. Toutes les couches sociales sont \\u00e9ligible au service Auxilium.\",\"project_money_source\":\"Les utilisateurs sont soumis \\u00e0 un syst\\u00e8me d\\u2019abonnement mensuel trimestriel, semestriel ou annuel (au choix du client). Ainsi, pour gagner de l\\u2019argent, nous pr\\u00e9voyons faire du profit sur l\'acquisition de nouveaux clients mais aussi sur leurs r\\u00e9abonnements.\",\"project_cost\":\"9 173 537 F CFA\",\"reglementvalide\":1,\"uuid\":\"966bfb1e-7bd6-4562-a503-19d0f57a033f\",\"status_id\":1,\"id\":8}','http://startupchallenge.moov-africa.ga/participants','160.119.161.248','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:100.0) Gecko/20100101 Firefox/100.0',NULL,'2022-05-30 09:06:27','2022-05-30 09:06:27'),(66,NULL,NULL,'updated','App\\Models\\Participant',8,'{\"uuid\":\"966bfb1e-7bd6-4562-a503-19d0f57a033f\",\"fichier_administrative\":null,\"fichier_administrative_size\":null,\"fichier_administrative_type\":null}','{\"uuid\":\"966bfb1f-06b7-47b2-8e8e-b294b45ccddf\",\"fichier_administrative\":\"6fe4ca988c14fe4fde190a9f819dcc57.pdf\",\"fichier_administrative_size\":663213,\"fichier_administrative_type\":\"pdf\"}','http://startupchallenge.moov-africa.ga/participants','160.119.161.248'