'\\u00e9valuer la r\\u00e9alit\\u00e9 du probl\\u00e8me.\",\"project_problem_current_solve\":\"Le probl\\u00e8me n\'est pas r\\u00e9solu et demeure tout entier. Toutefois, nous constatons que chaque intervenant dans la cha\\u00eene essaie de r\\u00e9soudre le probl\\u00e8me de fa\\u00e7on isol\\u00e9e, ce qui ne prend pas en compte sa r\\u00e9solution \\u00e0 grande \\u00e9chelle.\",\"project_problem_solution\":\"EYONE GABON propose une solution digitalisant l\'activit\\u00e9 des professionnels de la sant\\u00e9 (dossiers patients, facturation, organisation, etc) en permettant d\\u2019interagir avec les organismes de sant\\u00e9 et de remboursement puis, les patients.\",\"project_problem_solution_innovative\":\"Notre solution est innovante car elle est interop\\u00e9rable et bas\\u00e9e sur un r\\u00e9f\\u00e9rentiel commun et propose, l\'usage d\'un Num\\u00e9ro d\'Identification National du Patient (NIP) ; c\'est un agr\\u00e9gateur des Structures et Professionnels de la sant\\u00e9 et d\'Assureurs.\",\"project_problem_solution_link\":\"Oui, nous disposons d\'un lien pour tester notre solution.\",\"project_problem_solution_level\":\"Le niveau de d\\u00e9veloppement est de 100% cependant, nous r\\u00e9servons un taux de 10% par rapport aux adaptations sp\\u00e9cifiques \\u00e0 faire en fonction de l\'existant ou \\u00e0 la demande du client.\",\"project_payment\":\"Les structures m\\u00e9dicales (H\\u00f4pitaux, Cliniques, Centre de n\\u00e9phrologie, Cabinets m\\u00e9dicaux, Pharmacies, Dentistes, Laboratoires d\'analyses m\\u00e9dicales, ...), les Assureurs et les patients.\",\"project_money_source\":\"Nous gagnerons l\'argent en fonction des choix du client final : redevance mensuelle, achat de licences d\'utilisation, contrat de maintenance, revenu sharing, la t\\u00e9l\\u00e9transmission de donn\\u00e9es.\",\"project_cost\":\"Le co\\u00fbt de mise en place est modulable par rapport aux fonctionnalit\\u00e9s souhait\\u00e9es par chaque structure de sant\\u00e9 