  `complementinfos` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'complement infos du participant',
  `reglementvalide` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'complement infos du participant',
  `project_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'nom du projet',
  `project_problem` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem',
  `project_problem_eval` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_eval',
  `project_problem_current_solve` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_current_solve',
  `project_problem_solution` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_solution',
  `project_problem_solution_innovative` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_solution_innovative',
  `project_problem_solution_link` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_solution_link',
  `project_problem_solution_level` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_problem_solution_level',
  `project_payment` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_payment',
  `project_money_source` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_money_source',
  `project_cost` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'project_cost',
  `statut_video_id` bigint unsigned DEFAULT NULL COMMENT 'reference du statut de video',
  `statut_video_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'nom de du statut de video',
  PRIMARY KEY (`id`),
  KEY `participants_status_id_foreign` (`status_id`),
  KEY `participants_statut_video_id_foreign` (`statut_video_id`),
