79629f.pdf',696532,'pdf',NULL,1,'Stock','Stocks Epic','Oui 80 % en sondage','Manuellement ou accessoirement via Excel','Gestion quotidienne des Stocks sur Téléphone Android ou Mac avec cobtrôle à distance .','Inexistante au Gabon','Oui','90%','Epiciers; Chefs de PMEet PMI voire les Ménages','Avec 6 commerciaux et la vente d\'abonnements avec un objectif de 2 ventes pat vendeurs par jour','5 millions. Pour une explotation en phase avec le processus de déploiement',NULL,NULL),(5,'965efcea-a005-47d4-b732-18c9f6b7a29b',NULL,1,0,'2022-05-23 22:05:42','2022-05-23 22:05:43','MOUITY Patrick',NULL,'Patrick.mouity@gmail.com','065 23 84 00','95d3985d4669ce6bdf7667c870088df3.pdf',363879,'pdf','423ea78ae87eadcf3f22cabab670e8f9.pdf',641968,'pdf',NULL,1,'STOCKS EPIC','Gestion des Sticks quotidienne des Epiceries sans être obligées de fermer momentanément','Oui. 80% dz demandeurs d\'une solution ergonomique pour la gestion de Stocks','En proposant une gestion automatiser des stocks via Téléphone Android ou Mac avec iun contrôle à distance.','Nous proposons une gestion automatiser des stocks via Téléphones portables via un serceur dédié.','La solution est inexistante au Gabon','Oui','90%','Les EPICERIES/ PME/PMI/ Ménages','Par le recrutement de 6 commerciaux qui auront un objectif chacun de vente de 2 ventes par jour. Soit un CA de 128 millions','5 mllions pour la première phase abec des priemières ventes.',NULL,NULL),(6,'9669cb91-a0b9-47a7-aa35-8df87b53e37e',NULL,1,0,'2022-05-29 07:01:49','2022-05-29 07:01:50','MENDENE Jean-Arsene',NULL,'bkmgabon@gmail.com','062814686 / 062736220 /  066756196','48ab8fd2bd1823ef4b108af8e95f71cb.pdf',397168,'pdf','c98c6a1a8e466d2c6230786fee44c7c4.pdf',481019,'pdf',NULL,1,'Allô Santé','Comme problème il y\'a l\'archivage encombrante dans les structures sanitaire, le suivi des patients qui peut faussé pour cause de perte de document','oui','Ce problème est juste contourné, les dossier médicaux sont sur papier et pour la perte des données médicaux aux niveau de le structure sanitaire est irréversible','Allô Santé Dématérialise les dossier médicaux afin de garantir la durabilité données.','Allô santé vise a interconnecter toutes les structures hospitalière.','non','20 ù%','Les patients de la population gabonaise','La création du dossier (à vis) qui coute 2000f par patient et la mise a jour régulière des informations médicales a chaque consultation du patient dans une structure sanitaire qui vaut 200f','Nous l\'estimons à 21.550.000FCFA',NULL,NULL),(7,'966a569f-1da1-4bc2-bbf8-661e488bc4ee',NULL,1,0,'2022-05-29 13:30:39','2022-05-29 13:30:39','BEKALE Joël',NULL,'joel.bekale@trackallsecure.com','+24166610098','7ac253c641a602c41a7d29a9fc9d9b63.pdf',3165182,'pdf','07949ddd411e90ec2a15c4f67f531674.pdf',4047266,'pdf',NULL,1,'TRACKALLSECURE','Absence d’une meilleure visibilité ou traçabilité  de la chaine de valeur des activités','https://setrag.ga/index.php?url=bon-a-savoir/service-apres-vente/perte-deterioration-bagage, https://www.facebook.com/agenceforetbois, https://twitter.com/agenceforetbois','Utilisation d’un système d’information manuel. Enregistrement des informations de chaque étape de la chaine de valeur des activités sur support manuel','Utilisation d’un système  digital ou numérique de la chaîne de valeur des   activités pour une meilleure visibilité en temps réel des moyens de transport, des équipements, des marchandises et des personnes','Données fiables, gain de temps administratif, limitation supports papiers, Base de données mise à jour à temps réel, Partage d’informations, etc…','Chaine de valeur Agricole:   https://www.trackallsecure.com/application/hecterra , Chaine de valeur Commande/Livraison:   https://www.trackallsecure.com/application/logistic','Plateforme logicielle standard : 100%, Développement  spécifiques  aux différentes activités : 50%','Principalement les entreprises ayant une chaine de valeur à savoir les secteurs  agricole, pharmaceutique, forestier, ferroviaire, transport passagers, etc…','Moyens de transport: 15 000 F/unité/mois, Equipements & personnes mobiles/ QR code & code barre: 1 000 F/unité/mois,  Marchandises QR code/Code barre: 200F/unité, Smartphone personne/Application scan étiquette: 10 000 F/unité/mois','8 800 000 F CFA',NULL,NULL),(8,'966bfb1f-6247-43d4-bf08-3d5f1191b641',NULL,1,0,'2022-05-30 09:06:27','2022-05-30 09:06:28','Mexence Hermann OFFOUYA LOUSSOU',NULL,'offouya@hotmail.fr','074627828','6fe4ca988c14fe4fde190a9f819dcc57.pdf',663213,'pdf','a50013afb1abd70de087ea4e03e85d8d.pdf',1041825,'pdf',NULL,1,'Auxilium','La difficulté de localisation et les délais de prise en charge des sinistrés par les unités d’interventions des structures d’assistance sociale (SAMU, Sapeurs-Pompiers, Police, etc.).','Selon des témoignages recueillis au SAMU Social Gabonais, plusieurs interventions ont dû être annulées pour cause de localisations exactes des sinistrés.','À ce jour, aucune solution numérique n’existe sur le marché local pour pallier à ces problèmes. Les interventions sont toujours basées sur de simples appels téléphoniques.','Pour résoudre ce problème, nous offrons le service Auxilium.\r\nAuxilium est une application qui vous permet de demander à tout moment une intervention d’urgence géolocalisée, aux structures d’assistance sociale (SAMU, les Sapeurs-Pompiers, la Police, etc).','Le produit que nous proposons est innovant car qu’il fournit à la fois aux populations, et aux différents services un outil unique de géolocalisation et de communication afin d’accélérer la prise en charge des incidents nécessitants des interventions.','https://www.cover-art.me/auxilium','95 %','Le service Auxilium s’adresse à toute personne possédant un mobile connecté à internet. Peu importe l’âge, le sexe ou la profession. Toutes les couches sociales sont éligible au service Auxilium.','Les utilisateurs sont soumis à un système d’abonnement mensuel trimestriel, semestriel ou annuel (au choix du client). Ainsi, pour gagner de l’argent, nous prévoyons faire du profit sur l\'acquisition de nouveaux clients mais aussi sur leurs réabonnements.','9 173 537 F CFA',NULL,NULL),(9,'966c2e32-d241-4430-91b0-5247ea9c94a6',NULL,1,0,'2022-05-30 11:29:16','2022-05-30 11:29:17','NGUEMA MENGOME Marcel-Raumeyo',NULL,'marcelr.nguemam@setappssolution.com','+24162243462','31cea600fb7896d55bd24d38e820792c.pdf',408611,'pdf','88f5925e497293d4ed9e8b895e37fcb5.pdf',912482,'pdf',NULL,1,'SIKOLO','Le manque de plateforme permettant à ceux qui ne peuvent pas se former en présentiel de le faire en ligne. Cette plateforme doit permettre des paiements en ligne via Moov money, Airtel Money, cartes visa et MasterCard','Nous avons mené une enquête auprès d’amis, familles et sur les réseaux sociaux. Sur 100 professionnels, 90% ont besoin de formation continue mais sans les contraintes d\'emploi du temps, de lieu physique et avec un mode de paiement  adapté','Au Gabon, nous n\'avons pas trouvé de plateforme qui résout exactement le problème tel qu\'il se pose. Pour les plateformes internationales, le problème se trouve au niveau des modes de paiement','Nous proposons SIKOLO, une plateforme qui permet aux formateurs, de proposer des formations 100% en ligne. Le public cible pourra les suivre moyennant une inscription et un paiement en ligne via Moov money, Airtel money, Carte visa et MasterCard','Donner la possibilité à tout le monde de se former continuellement sans la contrainte d\'emploi du temps, sans la contrainte de déplacement et sans la contrainte du mode de paiement est une grande avancée technologique dans un pays comme le nôtre','https://sikolo.setappssolution.com/','95%','SIKOLO a pour cibles les professionnels, chefs d’entreprise, enseignants, chercheurs, médecins, cadres d’administration, chômeur à la recherche d’emploi, responsables politique et tous autres personnes qui a besoin de se faire former sur un sujet précis','SIKOLO génère des revenus par le coût des formations.  Nous prenons 35% ou 45% selon le forfait sur chaque inscription. Aussi, nous pensons qu’avec le trafic généré par la plateforme, nous serons sollicités pour de la publicité','10.000.000 FCFA',NULL,NULL),(10,'966c46bb-aab1-457e-95ca-07c092b96b68',NULL,1,0,'2022-05-30 12:37:52','2022-05-30 12:37:53','TSONGA Pacôme (EYONE GABON)',NULL,'pacome.tsonga@eyone.net','066139381 / 077131361','94ec956cb9116010b4a6303e464fc97d.pdf',929891,'pdf','e2e85146dec07af95e64b313b141264b.pdf',1747267,'pdf',NULL,1,'Digitalisation du parcours des soins du patient (système d\'échanges entre les organismes de remboursement, les prestataires de santé et les assurés).','Le parcours des soins complexes et le défaut de traçabilité des données médicales.','Nous disposons des données chiffrées nous permettant d\'évaluer la réalité du problème.','Le problème n\'est pas résolu et demeure tout entier. Toutefois, nous constatons que chaque intervenant dans la chaîne essaie de résoudre le problème de façon isolée, ce qui ne prend pas en compte sa résolution à grande échelle.','EYONE GABON propose une solution digitalisant l\'activité des professionnels de la santé (dossiers patients, facturation, organisation, etc) en permettant d’interagir avec les organismes de santé et de remboursement puis, les patients.','Notre solution est innovante car elle est interopérable et basée sur un référentiel commun et propose, l\'usage d\'un Numéro d\'Identification National du Patient (NIP) ; c\'est un agrégateur des Structures et Professionnels de la santé et d\'Assureurs.','Oui, nous disposons d\'un lien pour tester notre solution.','Le niveau de développement est de 100% cependant, nous réservons un taux de 10% par rapport aux adaptations spécifiques à faire en fonction de l\'existant ou à la demande du client.','Les structures médicales (Hôpitaux, Cliniques, Centre de néphrologie, Cabinets médicaux, Pharmacies, Dentistes, Laboratoires d\'analyses médicales, ...), les Assureurs et les patients.','Nous gagnerons l\'argent en fonction des choix du client final : redevance mensuelle, achat de licences d\'utilisation, contrat de maintenance, revenu sharing, la télétransmission de données.','Le coût de mise en place est modulable par rapport aux fonctionnalités souhaitées par chaque structure de santé (Hôpitaux, Cliniques, Cabinets médicaux, Pharmacies, Dentistes, Laboratoires d\'analyses médicales, ...) et les assureurs.',NULL,NULL);
